<script>
    import { browser } from "$app/environment";
    import panzoom from "@panzoom/panzoom";
    // import { panzoom } from '@panzoom/panzoom';
    // import * as panzoom from '@panzoom/panzoom';

    let { countryHover, countryClick, countryLeave } = $props();

    // const dispatch = createEventDispatcher();
    // let instance
    let panzoomRef = $state(null);
    let flag = $state(1);

    // const resetZoom2 = $derived(resetZoom(console.log("resetZoom")));

    // on:click={handleClick}
    // on:mouseover={handleMouseOver}
    // on:mouseleave={handleMouseLeave}
    // on:focus={() => {}}
    // role="presentation"
    // panzoom.reset()

    const initPanzoom = (node) => {
        // console.log("node: ", node);
        // node.addEventListener("panzoomchange", (event) => {
        //     console.log("panzoomchange: ", event.detail); // => { x: 0, y: 0, scale: 1 }
        //     if (event.detail.x != 0 || event.detail.y != 0) {
        //         flag = 0
        //     }
        // });
        node.addEventListener("panzoompan", (event) => {
            // console.log("panzoompan: ", event.detail);
            if (event.detail.x > 0.5 || event.detail.y > 0.5) {
                flag = 0;
            }
        });
        node.addEventListener("panzoomzoom", (event) => {
            // console.log("panzoomzoom: ", event.detail);
        });

        // node.addEventListener("wheel", (e) => {
        //     // console.log("wheel e: ", e)
        //     abc.zoomWithWheel(e);
        // })

        node.addEventListener("dblclick", (event) => {
            console.log("dblclick");
            // console.log("event.target: ", event.target.getAttribute("data-country"));
            // if (!event.target.getAttribute("data-country")) {
            if (!event.target.classList.contains("country")) {
                panzoomRef.reset();
            }
        });

        node.addEventListener("click", (event) => {
            if (event.target.classList.contains("country")) {
                console.log("click 1");
                    panzoomRef.destroy();
                    node.removeEventListener("wheel", def);
                    console.clear()
                    countryClick(event.target.id);
                
            } else {
                console.log("no click");
                flag = 1;
            }
        });
        panzoomRef = panzoom(node, {
            isSvg: true,
            cursor: "normal",
            disablePan: false,
            disableZoom: false,
            maxScale: 8,
            minScale: 1,
            touchAction: "none",
            contain: "outside",
            // zoomDoubleClickSpeed: 1,
            handleStartEvent: (event) => {
                event.preventDefault();
                event.stopPropagation();
            },
            // destroy: () => {
            //     console.log('destroy')
            // }
        });
        const def = (e) => {
            panzoomRef.zoomWithWheel(e);
        };
        node.addEventListener("wheel", def);
    };

    if (browser) {
        const elem = document.getElementById("map-europe");
        // console.log("elem: ", elem);
    }

    const handleClick = (e) => {
        // console.log("handleClick");
        // return
        const country = e.target.getAttribute("data-country");
        // console.log("country: ", country);
        // return
        // dispatch("countryClick", e.target.id);
        countryClick(e.target.id);
    };

    const handleMouseOver = (e) => {
        // console.log("handleMouseOver: ", e);
        // return
        // return;
        // console.log("e.target: ", e.target);
        // console.log("e.target.id: ", e.target?.id);
        // console.log("e.target.data-country: ", e.target.getAttribute("data-country"));
        // onCountryHover(e.target.id)
        // dispatch('countryHover', e.target.id)
        // const countryName = e.target.getAttribute("data-country")
        // const population = e.target.getAttribute("data-population")
        const clientX = e.clientX;
        // console.log("clientX: ", clientX);
        const rect = e.target.getBoundingClientRect();
        // console.log("rect: ", rect);
        const data = {
            id: e.target.id,
            countryName: e.target.getAttribute("data-country"),
            population: e.target.getAttribute("data-pop"),
            leagueIds: e.target.getAttribute("data-leagues-id")?.split(","),
            clientX: e.clientX,
            rect: e.target.getBoundingClientRect(),
        };
        // console.log("data: ", data);
        // dispatch("countryHover", data);
        countryHover(data);
    };
    const handleMouseLeave = (e) => {
        // dispatch("countryLeave")
        countryLeave();
    };

    const handlePointerDown = (e) => {
        console.log("handlePointerDown");
    };
    // export let onCountryHover = () => {}
</script>

